class CompanyModel {
  constructor(companyid, logoImg, name, type, backgroundImg) {
    this.companyid = companyid;
    this.logoImg = logoImg;
    this.name = name;
    this.type = type;
    this.backgroundImg = backgroundImg;
  }
}

export default CompanyModel;
